import React from 'react'
import { Routes, Route } from 'react-router-dom'
// Pages:
import Login from './pages/Login';

const App: React.FC = () => {
  return (
    <div className="App">
      <Routes>
        <Route path="/" component={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
